'use strict';

const Deployer = require('./lib/deployer');
var deployer = new Deployer();

deployer.deploy().then((result) => {
    if (result.code == 0) {
        console.log(result.message);
    } else {
        console.error(result.message);
    }
    process.exit(result.code);
});
